import styled from 'styled-components'
import Header from '../components/Header'
// Styles
import { StyledPageContainer } from '../styles/Global'

const Library = () => {
	return (
		<StyledPageContainer>
			<Header title="Library" />
		</StyledPageContainer>
	)
}

export default Library;
